Another 48 Hrs. (1990)

Verenigde Staten
Actie
93 minuten

geregisseerd door Walter Hill
met Eddie Murphy, Nick Nolte en Brion James

Politieman Jack Cates wordt weer samengebracht met de crimineel 
Reggie Hammond die nog maar een paar dagen in de cel hoeft door 
te brengen voordat hij weer een vrij man is. Samen moeten ze op 
zoek gaan naar de gewetenloze drugdealer 'The Iceman'. Ook dit 
keer hebben de twee mannen maar 48 uur de tijd om hun taak 
te volbrengen.

